"""
A filter to be used against `OtcOrder` object types. All fields are combined with a logical ‘and.’
"""
input OtcOrderFilter {
  """Filter by the object’s `amountIn` field."""
  amountIn: BigFloatFilter
  """Filter by the object’s `amountOut` field."""
  amountOut: BigFloatFilter
  """Checks for all expressions in this list."""
  and: [OtcOrderFilter!]
  """Filter by the object’s `assetInId` field."""
  assetInId: StringFilter
  """Filter by the object’s `assetOutId` field."""
  assetOutId: StringFilter
  """Filter by the object’s `blockId` field."""
  blockId: StringFilter
  """Filter by the object’s `id` field."""
  id: StringFilter
  """Negates the expression."""
  not: OtcOrderFilter
  """Checks for any expressions in this list."""
  or: [OtcOrderFilter!]
  """Filter by the object’s `ownerId` field."""
  ownerId: StringFilter
  """Filter by the object’s `paraBlockHeight` field."""
  paraBlockHeight: IntFilter
  """Filter by the object’s `partiallyFillable` field."""
  partiallyFillable: BooleanFilter
  """Filter by the object’s `relayBlockHeight` field."""
  relayBlockHeight: IntFilter
  """Filter by the object’s `status` field."""
  status: StringFilter
  """Filter by the object’s `totalFilledAmountIn` field."""
  totalFilledAmountIn: BigFloatFilter
  """Filter by the object’s `totalFilledAmountOut` field."""
  totalFilledAmountOut: BigFloatFilter
}

